        <div className='bg -white p-6  rounded-xl  w-80'>
            <input type="text" placeholder='Enter userName' className='w=full p-2 mb-4 border rounded' value ={username} onChange={(e)=>{setUsername(e.target.value)}}></input>
            <div className='relative mb-4'>
                <input type={showPassword ? 'text' :'password'} placeholder='Enter Password' className='w-full p-2 border rounded' value={password} onChange={(e)=>setPassword}/>


            </div>


        </div>
        
    </div>
  )
}

